import React from 'react';

class About extends React.Component {
	render() {
		return(
			<div class="fixedHeaderAdjust ">
				<div className="aboutHero ">
					<div className="secondaryLightOverlay">
						<h1 className="gridCenter white">About Friends of Bellingham</h1>
					</div>
				</div>
				<div>
					<div className="marginTop aboutSub">
						<h1 className="gridCenter primaryColor">Who is Chris Bellingham?</h1>
						<h6 className="gridCenter primaryColor marginBottom">A life of service and community</h6>
					</div>
				</div>
			</div>
		);
	}	
}

export default About;
